Common.LongDescription.Common.Text:
CBRE Agribusiness is pleased to present the opportunity to Sub Lease Huntly and obtain a Grazing Licence for Piney Creek, Stromlo ACT. The opportunity comprises two contiguous properties with an estimate carrying capacity of approximately 14,000 DSE.

Huntly is the largest rural lease property in the ACT. The property was recently acquired by the Land Development Authority (LDA**). The LDA (Lessor**) is seeking interest from suitably qualified parties with proven capability to manage large scale grazing properties to Sub Lease and manage the property for a minimum of 10 years.

The property is a long established grazing operation with three accommodation options and all supporting infrastructure less than 12 years of age.
The opportunity to secure a long-term lease of a large scale grazing property conveniently located close to the nation's capital in a reliable climate is rare, and should not be missed.

Key features of the opportunity include:

HUNTLY
• 1,605* hectares (3,967* acres);
• 10 year Sub Lease;
• Option to Sub Lease the whole property, or to exclude the Huntly Homestead;
• Quality working improvements facilitates ease of management of sheep and cattle;
• No restriction on stocking rate other than as may be required under the Land Management Agreement;
• Grazing intensity restricted by ground cover benchmarks and as may be required under the Land Management Agreement.

PINEY CREEK
• Adjoining 445* hectares (1,100* acres);
• 12 month Grazing Licence or possibly extended to 10 year Grazing Licence.

Sought after industrial land of 5,730sqm (approx)
*  Level vacant block in a strategic position in burgeoning Hume
*  Brilliant opportunity for astute investor or owner-occupier
*  Various build options available, will suit many users, see below

To use the premises only for the purpose of one or more of the following:
(i) bulk landscape supplies;
(ii) freight transport facility;
(iii) general industry;
(iv) industrial trades;
(v) light industry;
(vi) plant and equipment hire establishment;
(vii) recycling facility;
(viii) store; and
(ix) warehouse

GROSS FLOOR AREA:  'That the combined gross floor area of all buildings erected on the land shall not exceed 5,730 square metres.'

10-14 Vicars Street Mitchell was constructed in 1995 and is a free standing former mail delivery centre of one and two storey configuration and bitumen sealed carparking.

The ground floor comprises an open plan mail sorting area with separate male and female facilities.  The entry foyer is positioned at the front of the building and features an automatic glass sliding door from street level.

The upper floors are accessed via an internal staircase and provide open plan office with 3 smaller offices, boardroom, kitchen, toilet facilities, showers and personal storage locker rooms.

The property features bitumen sealed carparking area with attractive landscaping and staff break out area.

Vehicular access to the property is from Vicars Street whilst the loading dock is accessed from Callan Street.

The current Crown Lease purpose clause outlines the property's use only "for the purpose of a Mail Delivery Centre and ancillary uses".

A Development Application will be lodged to vary the Crown Lease purpose clause.  Subject to ACTPLA approval the DA will allow the property to be used for the following purposes:

(i) Ancillary use;
(ii) Communications facility;
(iii) Community use;
(iv) Craft workshop;
(v) Defence installation EXCLUDING all proposals where exercise activities are held, which involve the use of off-road vehicular movement, ammunition (live or blank), explosive devices or aircraft flyovers;
(vi) Freight transport facility;
(vii) Indoor recreation facility LIMITED TO gym and personal training;
(viii) Industrial trades;
(ix) Light industry;
(x) Plant and equipment hire establishment;
(xi) Recyclable materials collection;
(xii) Recycling facility;
(xiii) Scientific research establishment PROVIDED ALWAYS THAT this use may not be undertaken for the use or testing of one or more of the following: toxic chemicals, radioactive materials or explosive materials; human, animal or plant diseases; live animals; genetic engineering; and/or industrial processes which may interfere with the amenity of the surrounding area because of noise, vibration, odours or emissions; for an agricultural research facility involving one or more of the following: the use of agricultural chemicals or the keeping of stock at greater intensity than normal agricultural practice; experimentation with plant or animal diseases, or genetically-altered organisms; the introduction of plant or animal species that are not already established in the ACT; the use of radioactive material;
(xiv) Store;
(xv) Transport depot; and
(xvi) Warehouse;

This DA provides tremendous opportunities for this large 4,801 sqm block to suit the broad uses proposed.

The site is situated on a corner block with good street frontage.  Vicars Street runs parallel with Flemington Road, a major arterial road to the Gungahlin Town Centre, approximately 3km distant. Mitchell is Canberra's second major industrial suburb.  It is situated on the northern perimeter of the City with good access to both the Federal and Barton Highways, the major roadways connecting the National Capital to Sydney and Melbourne.  Canberra's CBD is approximately 10km distant, while the airport enjoys freeway conditions and is a 20 minute drive.

For further information on the sale of the property or to arrange for an inspection of this property, please contact the nominated representatives of CB Richard Ellis, Canberra.
